import { Menu, Search} from "semantic-ui-react";
import { Link } from "react-router-dom";
import './style.css';
function Header() {
    return (
        <Menu>
            <Menu.Item>
                <div>
                    Amigos
                </div>
            </Menu.Item>
        </Menu>
    );
}

export default Header;
